using namespace std;

int string_hash(string s)
{
	int res = 0;
	for (int i = 0; i < s.length(); i++)
	{
		res = res * 4 + (s[i] == 'A' ? 3 : (s[i] == 'C' ? 2 : (s[i] == 'G' ? 1 : 0)));
	}
	return res;
}

vector<string> findRepeatedDnaSequences3(string s) {
	vector<string> res;
	if (s.length() < 20) return res;
	unordered_set<int> dna;
	for (int i = 0; i < 10; i++) {
		for (int j = i; j < s.length() - 10; j += 10) {
			string ss = s.substr(j, 10);
			int h = string_hash(ss);
			if (dna.find(h) != dna.end())
				res.push_back(ss);
			else
				dna.insert(h);
		}
	}
	return res;
}

vector<string> findRepeatedDnaSequences(string s) {
	vector<string> res;
	if (s.length() < 20) return res;
	unordered_map<string, int> dna;
	for (int i = 0; i < 10; i++) {
		for (int j = i; j < s.length() - 10; j += 10) {
			dna[s.substr(j, 10)]++;
		}
	}
	for (auto it = dna.begin(); it != dna.end(); it++) {
		if (it->second > 1) res.push_back(it->first);
	}
	
	return res;
}

vector<int> KMP(string S, string K)
{
	vector<int> next(K.size() + 1, -1);
	vector<int> matches;

	if (K.size() == 0) 
	{
		matches.push_back(0);
		return matches;
	}
	for (int i = 1; i <= K.size(); i++)
	{
		int pos = next[i - 1];
		while (pos != -1 && K[pos] != K[i - 1]) pos = next[pos];
		next[i] = pos + 1;
	}

	int sp = 0;
	int kp = 0;
	while (sp < S.size())
	{
		while (kp != -1 && (kp == K.size() || K[kp] != S[sp])) kp = next[kp];
		kp++;
		sp++;
		if (kp == K.size()) {
			matches.push_back(sp - K.size());
			break;
		}
	}

	return matches;
}

vector<string> findRepeatedDnaSequences2(string s) {
	vector<string> res;
	if (s.length() < 20) return res;
	for (int i = 0; i < s.length() - 20; i++) {
		string s1 = s.substr(i, 10);
		string s2 = s.substr(i + 10);
		vector<int> re = KMP(s2, s1);
		if (re.size() > 0) res.push_back(s1);
	}

	return res;
}

vector<string> findRepeatedDnaSequences4(string s) {
	vector<string> res;
	if (s.length() <= 10) return res;
	unordered_set<int> dna;
	for (int i = 0; i < s.length() - 10; i++) {
		int code = string_hash(s.substr(i, 10));
		for (int j = i + 1; j <= s.length() - 10; j++) {
			int h = string_hash(s.substr(j, 10));
			if (h == code) {
				if (dna.find(h) == dna.end())
					res.push_back(s.substr(i, 10));
				dna.insert(h);
				break;
			}
		}
	}
	return res;
}

vector<string> findRepeatedDnaSequences5(string s) {
	vector<string> res;
	if (s.length() <= 10) return res;
	unordered_set<int> dna;
	unordered_set<string> letters;
	for (int i = 0; i <= s.length() - 10; i++) {
		string ss = s.substr(i, 10);
		int code = string_hash(ss);
		if (dna.find(code) != dna.end()) {
			if (letters.find(ss) == letters.end())
				letters.insert(ss);
		}
		else
		{
			dna.insert(code);
		}
	}
	for (auto it = letters.begin(); it != letters.end(); it++)
	{
		res.push_back(*it);
	}
	return res;
}

vector<string> findRepeatedDnaSequences6(string s)
{
	vector<string> res;
	if (s.length() <= 10) return res;
	unordered_set<string> dna;
	unordered_set<string> letters;
	for (int i = 0; i < s.length() - 10; i++) {
		string ss = s.substr(i, 10);
		if (dna.find(ss) != dna.end()) {
			if (letters.find(ss) == letters.end())
				letters.insert(ss);
		}
		else dna.insert(ss);
	}
	for (auto it = letters.begin(); it != letters.end(); it++)
	{
		res.push_back(*it);
	}
	return res;
}

